/**
 * Inventory
 * Defines this entity's inventory properties.
 */
export type EntityComponentMinecraftInventory = {
  /**
   * Additional Slots Per Strength
   * Number of slots that this entity can gain per extra strength.
   * @default 0
   */
  additional_slots_per_strength?: number;
  /**
   * Can Be Siphoned From
   * If true, the contents of this inventory can be removed by a hopper.
   * @default false
   */
  can_be_siphoned_from?: boolean;
  /**
   * Container Type
   * Type of container this entity has. Can be horse, minecart_chest, chest_boat, minecart_hopper, inventory, container or hopper
   * @default "none"
   */
  container_type?:
    | 'horse'
    | 'minecart_chest'
    | 'chest_boat'
    | 'minecart_hopper'
    | 'inventory'
    | 'container'
    | 'hopper';
  /**
   * Inventory Size
   * Number of slots the container has.
   * @default 5
   */
  inventory_size?: number;
  /**
   * Private
   * If true, only the entity can access the inventory.
   * @default false
   */
  private?: boolean;
  /**
   * Restrict To Owner
   * If true, the entity's inventory can only be accessed by its owner or itself.
   * @default false
   */
  restrict_to_owner?: boolean;
};

